const User = (props) => {
    const name = props.userData.name;
    //const imgUrl = require(props.userData.avatar_url + "");
    const login = props.userData.login;
    const id = props.userData.id;
    const repos =props.reposData;

    let recentRepos = [];
    if (repos.length > 4) {recentRepos = repos.slice(0,4)} else {recentRepos = repos};
    const repoList = recentRepos.map((repo) =>
    <li key={repo.id}>
        <a href=''>{repo.name}</a>
    </li>
    );
    const isLoaded = props.isLoaded;

  return (
    <div>
        {isLoaded ?
        <div>
        <h1>{name}</h1>
        <img src='' alt='userImg' />
        <p>login: {login}</p>
        <p>id: {id}</p>
        <h2>REPOS:</h2>
        <ul>{repoList}</ul>
        </div> :
        <div>
            <h1>Still loading</h1>
            </div>
        }

    </div>
  )
}

export default User
